    </p>

<pre>
<code>
 1. UPDATE x y z W
 2. QUERY  x1 y1 z1 x2 y2 z2
</code>
</pre>

    <p><b>Output Format</b></p>
    <p>Print the result for each QUERY.</p>

    <p><b>Constrains</b></p>

    <p>

        1 <= T <= 50<br />
        1 <= N <= 100<br />
        1 <= M <= 1000<br />
        1 <= x1 <= x2 <= N<br />
        1 <= y1 <= y2 <= N<br />
        1 <= z1 <= z2 <= N<br />
        1 <= x,y,z <= N<br />
